import React from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";
import {NavLink} from "react-router-dom";

const Header = () => {
    return (
        <Navbar className="mb-4" bg="primary" expand="lg">
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav>
                    <NavLink style={{color: "white"}} className="nav-link fs-4">Бронировать</NavLink>
                    <NavLink style={{color: "white"}} className="nav-link fs-4">Мои бронирования</NavLink>
                    <NavLink style={{color: "white"}} className="nav-link fs-4">История бронирований</NavLink>
                    <NavLink style={{color: "white"}} className="nav-link ">Выйти</NavLink>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
};

export default Header;
